import React from "react";
import "./Table.css";
import table from "../data/tabledata.json";

const Table = () => {
  return (
    <div>
      <div className="table">
      <div className="table__content">
      <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Company</th>
              <th>Role</th>
              <th>Status</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
           {
               table.map
           }
            <tr>
              <td>Alfreds Futterkiste</td>
              <td>Maria Anders</td>
              <td>Germany</td>
              <td>Germany</td>
              <td>Germany</td>
            </tr>
          </tbody>
        </table>
      </div>

      </div>
    </div>
  );
};

export default Table;
